import React, { useState } from "react";

function App() {
  const [tarefas, setTarefas] = useState([
    "Pagar Contas",
    "Estudar React Hooks",
  ]);

  return (
    <div>
      <ul>
        {tarefas.map((tarefa) => (
          <li>{tarefa}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
